import React from 'react';
import { Menu, Header, Input } from 'semantic-ui-react';
import duck from '../ressources/dance-dancing-duck.gif';

function NavBar() {
    return (
        <Menu vertical fixed='left'>
            <Menu.Header >
                <img src={duck} style={{ borderRadius: "100px", maxWidth: "200px", margin: "20px" }} alt="logo" />
                Ducking RSS
            </Menu.Header>
            <Menu.Item>
                <Input icon='search' placeholder='Search...' />
            </Menu.Item>
            <Menu.Item>
                Home
                <Menu.Menu>
                    <Menu.Item
                        name='community'
                        active />
                </Menu.Menu>
            </Menu.Item>
        </Menu>
    )
}

export default NavBar;
